import React, { useState } from "react";
import {
  Modal,
  ModalHeader,
  ModalBody,
  CardBody,
  Button,
  ModalFooter,
} from "reactstrap";

const ModalEditInfo: React.FC = () => {
  const [ showModal, setShowModal ] = useState(true);
  const toggle = () => setShowModal(!showModal);

  return (
    <Modal
      backdrop="static"
      isOpen={showModal}
      centered
      toggle={toggle}
    >
      <ModalHeader toggle={toggle}>Editar informações</ModalHeader>
      <ModalBody>
        <CardBody className="p-2 border">

          <ModalFooter className="border-0">
            <Button color="default" onClick={toggle}>
              Close
            </Button>
            <Button color="primary" onClick={() => console.log("")}>
              Confirmar
            </Button>
          </ModalFooter>
        </CardBody>
      </ModalBody>
    </Modal>
  );
};

export default ModalEditInfo;
